import React, { Component } from 'react';


class infoWindows extends Component {
  render (){
  return (
 <div>
      <h1 id="firstHeading" className="firstHeading">
        {this.props.b_type}
      </h1>
      <div id="bodyContent">
        <p>
            {this.props.details}
        </p>
        <p>
        start date: {this.props.start_date}
        </p>
        <p>
        end date: {this.props.end_date}
        </p>
    </div>
    </div>
  );
}
}

export default infoWindows;
